import React from 'react'
import './Home.css';
import Product from './Product';

function Home() {
    return (
        <div className="home">
            <div className="home_container">
            <img
            className="home_image"
             src="/banner_img.jpg" alt=""
            />

                <div className="home_row">
                     <Product
                     title="The lean startup"
                     price={29.99}
                     image="/book2.jpg"
                     rating={5} 
                     />

                     <Product 
                     title="Book of year"
                     price={19.99}
                     image="/book2.jpg"
                     rating={5}
                     />

                     <Product 
                     title="Next Goal"
                     price={39.99}
                     image="/book2.jpg"
                     rating={5}
                     />
                     <Product 
                     title="Look at this workbook"
                     price={15.99}
                     image="/book2.jpg"
                     rating={5}
                     />
                </div>

                <div className="home_row">
                <Product 
                title="Holy book"
                price={9.99}
                image="/book2.jpg"
                rating={5}
                />

                <Product 
                title="special gift"
                price={39.99}
                image="/book2.jpg"
                rating={5}
                />
                <Product 
                title="gift p"
                price={15.99}
                image="/book2.jpg"
                rating={5}
                />
                </div>

                <div className="home_row">
                <Product />
            </div>
        </div>
        </div>
    );
}

export default Home;
